import React, { useState, useEffect } from "react";
import * as services from "../services/personelServices";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogTitle from "@mui/material/DialogTitle";
import TextField from "@mui/material/TextField";
import MenuItem from "@mui/material/MenuItem";
import Select from "@mui/material/Select";
import InputLabel from "@mui/material/InputLabel";

const columns = [
  { id: 'personelName', label: 'Personel Adı', minWidth: 170 },
  { id: 'personelSurname', label: 'Personel Soyadı', minWidth: 170 },
  { id: 'personelSicilNo', label: 'Personel Sicil No', minWidth: 170 },
  { id: 'personelBirimi', label: 'Personel Birimi', minWidth: 170 },
  { id: 'personelGorevi', label: 'Personel Görevi', minWidth: 170 },
  { id: 'actions', label: 'Actions', minWidth: 170 },
];

export default function PersonelPage() {
  const [personelList, setPersonelList] = useState([]);
  const [open, setOpen] = useState(false);
  const [newPersonel, setNewPersonel] = useState({
    personelName: '',
    personelSurname: '',
    personelSicilNo: '',
    personelBirimi: '',
    personelGorevi: '',
    personelGender: '',
    personelBirthday: '',
    medeniDurum: '',
    personelTc: '',
    personelEdu: '',
    activity: '',
    photo: '',
    iseGirisTarihi: '',
    iseCikisTarihi: '',
    ilkPozisyon: '',
    ilkUnvan: '',
    ayrilmaNedeni: '',
  });

  useEffect(() => {
    services.getPersonel().then((res) => {
      setPersonelList(res.data);
    });
  }, []);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
    setNewPersonel({
      personelName: '',
      personelSurname: '',
      personelSicilNo: '',
      personelBirimi: '',
      personelGorevi: '',
      personelGender: '',
      personelBirthday: '',
      medeniDurum: '',
      personelTc: '',
      personelEdu: '',
      activity: '',
      photo: '',
      iseGirisTarihi: '',
      iseCikisTarihi: '',
      ilkPozisyon: '',
      ilkUnvan: '',
      ayrilmaNedeni: '',
    });
  };

  const handleChange = (e) => {
    setNewPersonel({
      ...newPersonel,
      [e.target.name]: e.target.value,
    });
  };

  const handleCreatePersonel = () => {
    services.createPersonel(newPersonel).then(() => {
      // Refresh personel list after creation
      services.getPersonel().then((res) => {
        setPersonelList(res.data);
      });
      handleClose();
    });
  };

  return (
    <Paper sx={{ width: "100%", overflow: "hidden" }}>
      <Button variant="contained" color="primary" onClick={handleClickOpen}>
        Yeni Personel Ekle
      </Button>
      <TableContainer sx={{ maxHeight: 440 }}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {personelList
              .map((row) => (
                <TableRow hover role="checkbox" tabIndex={-1} key={row.personelSicilNo}>
                  {columns.map((column) => (
                    <TableCell key={column.id} align={column.align}>
                      {row[column.id]}
                    </TableCell>
                  ))}
                </TableRow>
              ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Yeni Personel Ekle</DialogTitle>
        <DialogContent>
          <TextField
            margin="dense"
            id="personelName"
            name="personelName"
            label="Personel Adı"
            type="text"
            fullWidth
            variant="outlined"
            value={newPersonel.personelName}
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            id="personelSurname"
            name="personelSurname"
            label="Personel Soyadı"
            type="text"
            fullWidth
            variant="outlined"
            value={newPersonel.personelSurname}
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            id="personelSicilNo"
            name="personelSicilNo"
            label="Personel Sicil No"
            type="text"
            fullWidth
            variant="outlined"
            value={newPersonel.personelSicilNo}
            onChange={handleChange}
          />
          <InputLabel id="personelBirimi-label">Personel Birimi</InputLabel>
          <Select
            labelId="personelBirimi-label"
            id="personelBirimi"
            name="personelBirimi"
            value={newPersonel.personelBirimi}
            onChange={handleChange}
            fullWidth
          >
            <MenuItem value="Birim1">Birim1</MenuItem>
            <MenuItem value="Birim2">Birim2</MenuItem>
            {/* Add other birim options */}
          </Select>
          <InputLabel id="personelGorevi-label">Personel Görevi</InputLabel>
          <Select
            labelId="personelGorevi-label"
            id="personelGorevi"
            name="personelGorevi"
            value={newPersonel.personelGorevi}
            onChange={handleChange}
            fullWidth
          >
